import { Table, TableBody } from "@material-ui/core";
import TableTaskItem from "./TableTaskItem";

export default function TableTask() {
  return (
    <Table>
      <TableHead></TableHead>
      <TableBody>
        <TableTaskItem />
      </TableBody>
    </Table>
  );
}
